ndChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          The most common thing we want to do is to have two containers side by side.\n\n          ");e.appendChild(o,i);var i=e.createElement("code"),d=e.createTextNode("\n");e.appendChild(i,d);var d=e.createComment("");e.appendChild(i,d);var d=e.createTextNode("\n          ");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode("\n\n          This example may introduce more questions than it answers.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createComment("\n   ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/2");var o=e.createTextNode("\n       ");e.appendChild(l,o);var o=e.createElement("code"),i=e.createTextNode("\n");e.appendChild(o,i);var i=e.createComment("");e.appendChild(o,i);var i=e.createTextNode("\n       ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n       ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n         This is the container class for all grids, and must be present. This is essential as the most basic way\n         of building a grid is to give all children a left spacing, then subtract one spacing from the parent to line\n         them up. Without this wrapper, everything breaks. It is also worth noting there are few different flavours that\n         can be tacked on via modifiers, namely `.layout--flush` which will strip all the spacing between the columns.\n       ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n       ");e.appendChild(l,o);var o=e.createElement("code"),i=e.createTextNode("\n");e.appendChild(o,i);var i=e.createComment("");e.appendChild(o,i);var i=e.createTextNode("\n       ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n       ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n        A few things at play here, firstly the `layout__item` class is again, essential for the grid to work. This\n        is what applies the necessary inline-block and some nice tweaks. Secondly, `u-1/2` is an atomic class that only\n        applies a percentage width. You will almost never require anything outside of u-1/4, u-1/3, u-1/2. If you do,\n        for some reason, smaller fractions can be toggled in the settings file `settings/_layout`. For example, to have\n        a 66%/33% grid, you would need: `u-2/3` and `u-1/3`.\n       ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n       ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n        Yes the HTML comments between layout__items are an eye soar, and yes they are necessary. This is unfortunate but\n        due to the way whitespace is handled with inline-blocks, if you do not close the space you can sometimes be left\n        with physical gaps between your elements, which can cause incorrect distances but more often than not, will cause your\n        columns totalling 100% to overflow and not fit on one line. This used to be fixable with CSS, but Chrome 38(?) introduced a change and killed that overnight. Thanks Google.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n       ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n        Occasionally writing a HTML comment does not override the power and simplicity of this grid and is not even remotely close to a worthy reason to not use it.\n       ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          Lastly, you may want to ditch the gutters altogether, in which case simply add\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("code"),i=e.createTextNode("\nlayout layout--flush\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createTextNode("\n    ");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode("\n  ");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n\n  ");e.appendChild(n,a);var a=e.createElement("div");e.setAttribute(a,"class","styleguide-item");var r=e.createTextNode("\n    ");e.appendChild(a,r);var r=e.createElement("h2");e.setAttribute(r,"class","styleguide-item__title");var l=e.createTextNode("BEM");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode("\n    ");e.appendChild(a,r);var r=e.createElement("div");e.setAttribute(r,"class","layout");var l=e.createTextNode("\n      ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/1");var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          Block, element, modifier. This is the approach we are taking with regards to naming conventions.\n\n          In conjunction with the aforementioned exception, there is one more: Ember's default active class is,\n          you guessed it: `.active`, for the sake of consistency and ease of use we will occasionally use this class.\n          Other than those, we are using to the T BEM within our stylesheets.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          All ELEMENTS must be their own unique selector (no nesting!). All MODIFIERS must be nested (how annoying!).\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          These are not strictly enforced, but encouraged that for the elements and modifiers you stick to some of our\n          naming standards for consistency, it will be quite rare for you to fall outside of these:\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("code"),i=e.createTextNode("\nclass___actions\nclass___action\nclass___item\nclass___content\nclass___label\nclass___title\n\nclass--is-selected\nclass--is-disabled\nclass--is-highlighted\nclass--has-actions\nclass--has-{action}\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n          ");e.appendChild(l,o);var o=e.createElement("code"),i=e.createTextNode("\n& {\n  width: 100%;\n}\n\n.ko-info-bar__item {\n  color: red;\n\n  &--is-active {\n    border: 1px solid $color-primary;\n  }\n}\n\n.ko-info-bar__action {\n  font-size: $font-size-small;\n}\n          ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createTextNode("\n    ");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode("\n  ");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n\n  ");e.appendChild(n,a);var a=e.createElement("div");e.setAttribute(a,"class","styleguide-item");var r=e.createTextNode("\n    ");e.appendChild(a,r);var r=e.createElement("h2");e.setAttribute(r,"class","styleguide-item__title");var l=e.createTextNode("Component CSS (&)");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode("\n    ");e.appendChild(a,r);var r=e.createElement("div");e.setAttribute(r,"class","layout");var l=e.createTextNode("\n      ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/2");var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          ");e.appendChild(o,i);var i=e.createElement("a");e.setAttribute(i,"href","https://github.com/ebryn/ember-component-css");var d=e.createTextNode("Component CSS — C(CSS)");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode(" was introduced about one third\n          of the way through the first beta build, it went through a lot of trial and error, and growing pains, but we believe\n          as it stands to have been implemented in a desirable way. As it is so new, it is wide open to feedback. We're confident\n          in it, but we have not yet seen it survive in the wild yet.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          The power that C(CSS) brings is the encapsulation and scoping of styles. This is done automagically by Ember.\n          All that it requires is in your `ko-component/` folder you have an accompanying `styles.scss` file. All selectors\n          in that file will have a class name generated and prepended to it. This is done by taking the name of the component\n          and adding a unique hash to the end. As a result, whatever you write in this file simply cannot be interfered with\n          outside of that scope. We have found this to be quite powerful, you can work on a style sheet with confidence that your changes\n          here will have a near non-existent ripple effect across the rest of the styles.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          We must strive to put as much CSS as we can feasibly fit into our components, there are some exceptions that are covered\n          later, but they should be few and far between. CSS in the global scope should be the final resort.\n        ");
e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          Simply put, if you have a component called: `ko-info-bar`, you may write a file like so:\n\n          ");e.appendChild(o,i);var i=e.createElement("code"),d=e.createTextNode("\n& {\n  width: 100%;\n}\n\n  .ko-info-bar__item {\n    display: inline-block;\n  }\n          ");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode("\n\n          This will generate:\n\n          ");e.appendChild(o,i);var i=e.createElement("code"),d=e.createTextNode("\n.ko-info-bar--4ja84 { width: 100%; }\n.ko-info-bar--4ja84 .ko-info-bar__item { display: inline-block; }\n          ");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode("\n\n          As you can see, the selector has been scoped out by requiring a unique, generated hash to access. The first knee-jerk\n          (and mine!) reaction to this approach is almost always the impact on repetition. Firstly, it really is not as big an\n          issue as first thought. Secondly, we have come to find this isolated way of writing CSS to be in the long run,\n          a time save — not sink. At the peak of this project, there may well be a few hundred redundant lines,\n          but that is nothing in contrast to the developers being able to write freely within the styles.scss file without\n          having to give thought to the outside world, nor test the endless implementations of the class they are changing.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createComment("\n   ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/2");var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n           The ampersand (&) selector is very useful to us as it allows us to select the component's wrapping class, the class\n           that is applied with a generated hash, in this instance: `ko-info-bar--4ja84`.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n       ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          This power comes with some caveats.\n\n          In order to use modifiers, we must break (and this is ");e.appendChild(o,i);var i=e.createElement("i"),d=e.createTextNode("only");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode(" place this should happen) BEM.\n\n          Which can then be used like so:\n\n          ");e.appendChild(o,i);var i=e.createElement("code"),d=e.createTextNode("\n& {\n  width: 100%;\n\n    &.has-error {\n      border: 1px solid red;\n    }\n}\n          ");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode("\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          What happens if you absolutely ");e.appendChild(o,i);var i=e.createElement("i"),d=e.createTextNode("must");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode(" style a component that is dependant on whether or not it is sitting in another component? In this instance you would use a contains selector:\n\n          ");e.appendChild(o,i);var i=e.createElement("code"),d=e.createTextNode('\n& {\n  width: 100%;\n\n    & [class*="ko-info-bar--"] {\n      background: red;\n    }\n}\n          ');e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode("\n\n          This is explicitly reserved for this problem. You may require this due to the cascading nature of CSS and inability\n          to move up the chain. This may force you to have to move upward, to come back down. As in, styling a child component\n          from a parent component. This is discouraged and avoided at all costs, but it has proven to be unavoidable in some cases.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createTextNode("\n    ");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode("\n  ");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n\n  ");e.appendChild(n,a);var a=e.createElement("div");e.setAttribute(a,"class","styleguide-item");var r=e.createTextNode("\n    ");e.appendChild(a,r);var r=e.createElement("div");e.setAttribute(r,"class","layout");var l=e.createTextNode("\n      ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/2");var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("h2");e.setAttribute(o,"class","styleguide-item__title"),e.setAttribute(o,"id","headings");var i=e.createTextNode("Selectors");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          Our rules on selectors are very simple: NEVER EVER FOR ANY REASON, LIKE, I HONESTLY COULDN'T CARE IF YOU\n          CAME WITH YOUR DIRTY CAP IN HAND BEGGING — NO — HTML — ELEMENT — SELECTORS.\n\n          Nothing you will ever say, do or cry about will ever change the fact we are not using HTML elements for selectors.\n\n          If you only require a quick small change and are trying to shortcut with an element selector, you Sir/Madam\n          are ripe for a utility class, else, it is time to write a class.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode('\n          "Although I admire the passion it would be good to have a few reasons why they invoke such rage, help justify it" - Stuart Quin, 12th October 2015\n        ');e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          Good question Stuart, the reasoning behind this is specificty in CSS is a huge problem and one that we are going to great lengths to\n          prevent, using HTML elements in selectors is the steroids of the specificty world, you will instantly be teleported into a world of\n          rapidly developing specifity with horrible side effects. A common theme of programming is to avoid coupling, calling CSS programming is a\n          borderline sin, but a lot of aspects carry over. Using HTML selectors causes a horrific dependance on HTML structure and type. We do not\n          want to be working with CSS that can break by someone changing a span to a div.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          What may be a quick fix, will potentially cause a lot of issues down the road.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("code"),i=e.createTextNode("\n.ko-info-bar ul > li > * > a { display: none; } //I dare you.\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          It is also worth noting that the Team JavaScript should never be selecting off of classes that are not prefixed with `.js-`.\n          This is important as we want to seperate concerns between JavaScript functionality and styling, this lubricates\n          refactoring as Team CSS can freely edit styles without having to go ahead and fix tests, magic!\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createComment("\n   ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/2");var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("h2");e.setAttribute(o,"class","styleguide-item__title"),e.setAttribute(o,"id","headings");var i=e.createTextNode("REM");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.createElement("p");e.setAttribute(o,"class","styleguide-item__content");var i=e.createTextNode("\n          Our REM usage is equally as simple, other than font sizes, it is not to be used anywhere else, ever.\n          We even have an elegant mixin that'll hold for your hand through the entire thing.\n\n          This helpful little devil will also deal with line-height. How helpful indeed.\n\n          ");e.appendChild(o,i);var i=e.createElement("code"),d=e.createTextNode("\n@include inuit-font-size(14px);\n@include inuit-font-size($font-size-small);\n          ");e.appendChild(i,d),e.appendChild(o,i);var i=e.createTextNode("\n        ");e.appendChild(o,i),e.appendChild(l,o);var o=e.createTextNode("\n      ");e.appendChild(l,o),e.appendChild(r,l);var l=e.createTextNode("\n    ");e.appendChild(r,l),e.appendChild(a,r);var r=e.createTextNode("\n  ");e.appendChild(a,r),e.appendChild(n,a);var a=e.createTextNode("\n\n  ");e.appendChild(n,a);var a=e.createElement("div");e.setAttribute(a,"class","styleguide-item");var r=e.createTextNode("\n    ");e.appendChild(a,r);var r=e.createElement("div");e.setAttribute(r,"class","layout");var l=e.createTextNode("\n      ");e.appendChild(r,l);var l=e.createElement("div");e.setAttribute(l,"class","layout__item u-1/2");var o=e.createTextNode("\n        ");e.appendChild(l,o);var o=e.cre